      //volvemos a usar el mismo componente, mismas propiedades pero diferente info
      title="Mi Segunda App"
      subtitle="Ya funciona tambien eaeaea"
      //acá no incluimos el componente del tiempo por lo que ni incluimos el prop tiempo
      />

    </div>



  );
}

export default App;
